mapper.select:
  	select  
		  , (
				SELECT
					CITY_NAME
				FROM
					FUN_CITY
				WHERE
					FUN_CITY.CITY_ID = VIP_BUY.CITY_ID
			) AS CITY_NAME,
			(
				SELECT
					IS_BROKER
				FROM
					WEB_CLIENT
				WHERE
					WEB_CLIENT.CITY_ID = VIP_BUY.CITY_ID
				AND WEB_CLIENT.CLIENT_ID = VIP_BUY.CLIENT_ID
			) AS IS_BROKER
		FROM
			VIP_BUY


				CREATION_TIME >= #{date1}


				AND CREATION_TIME <= #{date2}


				AND TRADE_TIME >= #{tradeTime1}


				AND TRADE_TIME <= #{tradeTime2}


				AND BUILD_ID = #{buildId,jdbcType=VARCHAR}


				AND BUILD_NAME like '%${buildName}%'


				AND CLIENT_ID = (SELECT CLIENT_ID FROM WEB_CLIENT WHERE CLIENT_MOBILE = #{clientmobile})


				And CITY_ID = #{cityId,jdbcType=SMALLINT}


				AND ROOM_L >= #{houseRoom1,jdbcType=TINYINT}


				AND ROOM_H <= #{houseRoom2,jdbcType=TINYINT}


				And PRICE_L >= #{price2,jdbcType=INTEGER}


				AND PRICE_H <= #{price2,jdbcType=INTEGER}


				AND CASE_STATUS = #{caseStatus,jdbcType=INTEGER}


				AND NEW_COMPLAIN = #{newComplain,jdbcType=TINYINT}


				 AND HOUSE_USEAGE = #{houseUseage,jdbcType=VARCHAR}


				AND AREA_L  >= #{houseArea1,jdbcType=INTEGER}


				AND AREA_H <= #{houseArea2,jdbcType=INTEGER}


				AND HOUSE_FITMENT = #{houseFitment,jdbcType=VARCHAR}


				AND HOUSE_RIGHT = #{houseRight,jdbcType=VARCHAR}


				AND INFO_SOURCE = #{infoSource,jdbcType=TINYINT}


				AND CREATOR_UID = #{creatorUid,jdbcType=INTEGER}


		ORDER BY TRADE_TIME DESC

  	  select 

	    from VIP_BUY
	    where CITY_ID = #{hftCityId}
     	and UGC_ID = #{ugcId}

