mapper.select:
SELECT pb.CITY_ID,BUY_ID,BUILD_NAME,HOUSE_REGION,REGION_NAME,HOUSE_ROUND,ROUND_NAME,HOUSE_SECTION,SECTION_NAME,BUY_SUBJECT,HOUSE_USEAGE,HOUSE_FITMENT,HOUSE_RIGHT,ROOM_L,ROOM_H,FLOOR_L,FLOOR_H,PRICE_L,PRICE_H,AREA_L,AREA_H,HOUSE_TYPE,HOUSE_YEAR_LOW,HOUSE_YEAR_HIGH,BUY_PAYTYPE,DOWN_PAY,CALL_COUNT,CASE_STATUS,CREATION_TIME,TRADE_TIMES,PURCHASE_COUNT,DOWN_TIME,FULL_TIME,TRADE_TIME,DESCP,TRADE_FLAG,ISURGENT,BUY_PRICE_UNIT,INFO_SOURCE,PB_TIME,1 as READED FROM PURCHASE_BORKER pb left join VIP_BUY vb on pb.CITY_ID = vb.CITY_ID AND pb.CASE_ID = vb.BUY_ID and pb.CASE_TYPE = 3
vb.CITY_ID = #{cityId} and FULL_TIME > getdate() and pb.ARCHIVE_ID=#{archiveId}
order by vb.CITY_ID,PB_TIME DESC

SELECT vb.CITY_ID,BUY_ID,BUILD_NAME,HOUSE_REGION,REGION_NAME,HOUSE_ROUND,ROUND_NAME,HOUSE_SECTION,SECTION_NAME,BUY_SUBJECT,HOUSE_USEAGE,HOUSE_FITMENT,HOUSE_RIGHT,ROOM_L,ROOM_H,FLOOR_L,FLOOR_H,PRICE_L,PRICE_H,AREA_L,AREA_H,HOUSE_TYPE,HOUSE_YEAR_LOW,HOUSE_YEAR_HIGH,BUY_PAYTYPE,DOWN_PAY,CALL_COUNT,CASE_STATUS,CREATION_TIME,TRADE_TIMES,PURCHASE_COUNT,DOWN_TIME,FULL_TIME,TRADE_TIME,DESCP,ISURGENT,BUY_PRICE_UNIT,INFO_SOURCE,(case when (pb.CALL_COUNT >0) then 1 else 0 end) READED from VIP_BUY vb left join PURCHASE_BORKER pb on vb.CITY_ID = pb.CITY_ID AND pb.CASE_ID = vb.BUY_ID and pb.CASE_TYPE = 3 and pb.ARCHIVE_ID=#{archiveId}
vb.CITY_ID = #{cityId} and FULL_TIME > getdate()
order by vb.CITY_ID,TRADE_TIME DESC

